create table if not exists crawler_t.brands
(
    id        int auto_increment
        primary key,
    en_name   varchar(30)  not null,
    ko_name   varchar(30)  not null,
    url       varchar(512) not null,
    thumbnail varchar(512) not null,
    icon      varchar(512) not null,
    content   varchar(150) not null
);

create table if not exists crawler_t.colors
(
    id    int auto_increment
        primary key,
    color varchar(20) not null
);

create table if not exists crawler_t.days
(
    id int auto_increment
        primary key,
    en varchar(30) not null,
    ko varchar(150) not null
);

create table if not exists crawler_t.lens
(
    id              int auto_increment
        primary key,
    ref_id          int          not null,
    name            varchar(100)  not null,
    color           varchar(80)  not null,
    color_id        int          not null,
    color_img       varchar(512) null,
    price           int          not null,
    graphic         float        not null,
    img             varchar(512) not null,
    detail_img      varchar(512) null,
    eye_thumbnail   varchar(512) not null,
    model_thumbnail varchar(512) null,
    period varchar (30) not null,
    period_classifi varchar(30)  not null,
    reviewcount     varchar(10)  not null,
    page_url        varchar(512) not null,
    brand_id        int          not null
);

create table if not exists crawler_t.like_table
(
    id      int auto_increment
        primary key,
    user_id varchar(30) not null,
    like_id int         not null
);

create table if not exists crawler_t.user
(
    id         int auto_increment
        primary key,
    user_id    varchar(30)  not null,
    password   varchar(150) not null,
    name       varchar(30)  not null,
    created_at datetime     not null,
    updated_at datetime     not null,
    constraint user_id
        unique (user_id)
);





